import './about_us.css'
import Component2 from './aboutus/component2'

const AboutUs=(props)=>{
    return(
        <div style={{paddingLeft:'2%',paddingRight:'20%'}}>
            <div className='profile_wrapper'>
                <Component2 className='each_prof' key='a'/>
                <Component2 className='each_prof' key='b'/>
                <Component2 className='each_prof' key='b'/>
            </div>
        </div>
    )
}
export default AboutUs;
